import React from 'react';

import { Line } from 'react-chartjs-2';

const people = [
  {"count":"2","age":"18"},
  {"count":"4","age":"21"},
  {"count":"1","age":"17"}
];
const data = {
  labels: people.map(person => person.age),
  datasets: [
    {
      label: 'Count',
      data: people.map(person => person.count),
      fill: false,
      borderColor: 'rgba(75,192,192,1)',
      lineTension: 0.1,
    },
  ],
};

const BarChart = () => <Line data={data} />;

export default BarChart;
